import Navbar from "../components/Navbar";
import BlogSection from '../containers/BlogSection'
import Footer from '../components/Footer'

const Blog = (props) => {
  return (
    <>
      <Navbar />
      <BlogSection/>
      <ul>
        {props.posts.map((post) => (
          <li key={post.id}>{post.title}</li>
        ))}
      </ul>
      <Footer/>
    </>
  );
};

export default Blog;
